local function loadFile(path)
	local file = fileOpen(path)
	if not file then
		return false
	end
	local count = fileGetSize(file)
	local data = fileRead(file, count)
	fileClose(file)
	return data
end


local senha = sha256(md5(""))
format = "NewMixMTA"
zamenamodels = { -- aki é para start modelagem bloqueada
[6157] = {txd="interior/6157txd", dff="interior/6157dff", col="interior/6157col"},

}

createBlip(943.93444824219,-1533.3511962891,14.390434265137, 14)


function zamenamodel()
	for id, model in pairs(zamenamodels) do
		if model.txd and #model.txd > 5 then
			local txd = loadFile(model.txd.."."..format)
			txd = decodeString("tea", txd, {key = senha})
			txd = engineLoadTXD(txd)
			if txd then
				engineImportTXD(txd, id)
			end
		end
		
		-- DFF
		if model.dff and #model.dff > 5 then
			local dff = loadFile(model.dff.."."..format)
			dff = decodeString("tea", dff, {key = senha})
			dff = engineLoadDFF(dff)
			if dff then		
				engineReplaceModel(dff, id)
			end
		end
		
		-- COL
		if model.col and #model.col > 5 then
			local col = loadFile(model.col.."."..format)
			col = decodeString("tea", col, {key = senha})
			col = engineLoadCOL(col)
			if col then		
				engineReplaceCOL(col, id)
				engineSetModelLODDistance(id, 300)
			end
		end
	end
end
addEventHandler("onClientResourceStart", root, zamenamodel)